import { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import Container from "@mui/material/Container";
import Card from "@mui/material/Card";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import MKBox from "components/MKBox";
import MKTypography from "components/MKTypography";
import Header from "components/Header";

function Dashboard() {
  const navigate = useNavigate();
  const [players, setPlayers] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState("");

  useEffect(() => {
    const authToken = localStorage.getItem("authToken");
    if (!authToken) {
      navigate("/auth");
      return;
    }

    const fetchPlayers = async () => {
      try {
        const response = await fetch(
          "https://x8ki-letl-twmt.n7.xano.io/api:TF3YOouP/kbfoundation_players",
          {
            headers: {
              Authorization: `Bearer ${authToken}`,
            },
          }
        );

        if (!response.ok) {
          throw new Error("Failed to fetch players data");
        }

        const data = await response.json();
        setPlayers(data);
      } catch (err) {
        setError(err.message);
      } finally {
        setIsLoading(false);
      }
    };

    fetchPlayers();
  }, [navigate]);

  return (
    <>
      <Header />
      <MKBox
        minHeight="100vh"
        width="100%"
        sx={{
          backgroundColor: "#f8f9fa",
          paddingTop: "70px",
          paddingBottom: "30px",
        }}
      >
        <Container>
          <MKTypography variant="h3" mb={4}>
            Players Dashboard
          </MKTypography>
          <Card>
            {isLoading ? (
              <MKBox p={3} textAlign="center">
                Loading players data...
              </MKBox>
            ) : error ? (
              <MKBox p={3} textAlign="center" color="error">
                {error}
              </MKBox>
            ) : (
              <TableContainer>
                <Table>
                  <TableHead>
                    <TableRow>
                      <TableCell>ID</TableCell>
                      <TableCell>Registration Date</TableCell>
                      <TableCell>Full Name</TableCell>
                      <TableCell>Email</TableCell>
                      <TableCell>Date of Birth</TableCell>
                      <TableCell>Position</TableCell>
                      <TableCell>Phone Number</TableCell>
                      <TableCell>Channel</TableCell>
                      <TableCell>Other Channel</TableCell>
                      <TableCell>Education</TableCell>
                      <TableCell>Shirt Size</TableCell>
                      <TableCell>Payment Reference</TableCell>
                      <TableCell>Player ID</TableCell>
                    </TableRow>
                  </TableHead>
                  <TableBody>
                    {players.map((player) => (
                      <TableRow key={player.id}>
                        <TableCell>{new Date(player.created_at).toLocaleDateString()}</TableCell>
                        <TableCell>{player.fullName}</TableCell>
                        <TableCell>{player.email}</TableCell>
                        <TableCell>{player.DOB}</TableCell>
                        <TableCell>{player.position}</TableCell>
                        <TableCell>{player.phonNumber}</TableCell>
                        <TableCell>{player.Channel}</TableCell>
                        <TableCell>{player.otherChannel || '-'}</TableCell>
                        <TableCell>{player.education}</TableCell>
                        <TableCell>{player.shirtSize}</TableCell>
                        <TableCell>
                          <MKTypography
                            variant="caption"
                            color={player.paymentReference ? "success" : "error"}
                          >
                            {player.paymentReference || 'Pending'}
                          </MKTypography>
                        </TableCell>
                        <TableCell>{player.pId || '-'}</TableCell>
                      </TableRow>
                    ))}
                  </TableBody>
                </Table>
              </TableContainer>
            )}
          </Card>
        </Container>
      </MKBox>
    </>
  );
}

export default Dashboard;
